import base64
import cv2
import matplotlib.pyplot as plt
import numpy as np
nparr = np.fromstring(b'', np.uint8)
im_bytes = base64.b64decode(nparr)
im_arr = np.frombuffer(im_bytes, dtype=np.uint8)  # im_arr is one-dim Numpy array
img = cv2.imdecode(im_arr, flags=cv2.IMREAD_COLOR)
imagen = cv2.cvtColor(img, cv2.COLOR_RGB2BGR)
gray=cv2.cvtColor(imagen, cv2.COLOR_BGR2GRAY)

corners=cv2.goodFeaturesToTrack(gray,100,0.1,1)
corners=np.int0(corners)
for corner in corners:
  x, y=corner.ravel()
  cv2.circle(imagen,(x,y),5,(255,0,0),-1)
mostrar=plt.imshow(imagen)
plt.show()